import React from 'react';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import './../App.css';


function RecipeCard({sourceUrl, image, dishType="RECIPE", title, readyInMinutes, aggregateLikes, }) {
    return (
      <a id='RecipeCard' href={sourceUrl} style={{textDecoration: "none", color: "inherit"}}>
        <Card style={{ width: "300px", height: "400px", borderRadius:0, paddingRight:0}}>
          <img variant="top" src={image} style={{objectFit: "cover"}}/> {/* Replace with "image" from api */}
          <Card.Body>
            <Card.Subtitle as="subtext" style={{ margin: "10px" }}>{dishType}</Card.Subtitle> {/* Replace with "dishType" from api */}
            <div></div>
            <Card.Title as="recipeTitle" style={{ margin: "10px" }}>{title}</Card.Title> {/* Replace with "title" from api */}
          </Card.Body>
        </Card>
      </a>
    );
  }

export default RecipeCard;
